import './index.css';
import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";


function App() {
  return (

    <nav className="w-full">
      <FiFeather />
      <hr className='' />
      <BiHomeAlt2 />
      <BiUser />
      <BiLogOut />
      <hr />
      <BiInfoCircle />
    </nav>

  );
}

export default App;
